var a=class{setItem(t,e){localStorage.setItem(t,JSON.stringify(e))}getItem(t){let e=localStorage.getItem(t);return e==null?null:JSON.parse(e)}pushItem(t,e){let l=this.getItem(t)??{localData:[]};l.localData.push(e),this.setItem(t,l)}removeItem(t,e){let l=this.getItem(t)??{localData:[]};l.localData=l.localData.filter(s=>s!==e),this.setItem(t,l)}checkItem(t,e){return(this.getItem(t)??{localData:[]}).localData.includes(e)}};export{a};
